// An asynchronous getData function that waits for the DB connection and returns our collection by Id
async function getData(req, res) {
  try {
    await client.connect();
    const db = client.db("professional");
    const collection = db.collection("professional");
    const professional = await collection.findOne({"_id": new ObjectId("644a9f79cf0b91d8ab09e8cd")});
    res.status(200).send(professional);
  } catch (err) {
    console.error(err);
    res.status(500).send("Error retrieving contacts");
  }
}

// Export the getData function
module.exports = {
  getData,
};
